import Header from '../components/header.js';
import Footer from '../components/footer.js';
import contactimg from '../SURSE/logos/Untitled_logo_4_free-file.jpg';

function Contact()
{
    return(
        <>
        <Header />
        <div className='w-full h-[400px] max-[640px]:h-[200px] relative flex items-center justify-center pl-10 pr-10 '>
            <div className='bg-[#748F80] overflow-hidden drop-shadow-3xl sm:h-[300px] h-[150px] w-[950px] rounded-full relative flex justify-start'>
            <img src={contactimg} className='rounded-full relative min-[640px]:scale-75 max-[640px]:w-[125px]' />
                <div className='bg-black w-full relative pt-10 text-white'>
                <h3 className='text-white font-bold text-center relative'>GUESS ELITE shop:</h3>
                <br /><br />
                <h3 className='text-white font-bold text-center relative'>&#x1F4CD; : 123 Consectetur at ligula 10660</h3>
                <h3 className='text-white font-bold text-center relative'>  010-020-0340</h3>
                <h3 className='text-white font-bold text-center relative'>info@company.com</h3>
                </div>
            </div>
        </div>
        <Footer />
        </>
    )
}

export default Contact;
